'''Zach Woods''' (born September 25, 1984) is an [[United States|American]] actor and comedian. From 2010-11, he portrayed [[Gabe Lewis]] on the NBC sitcom ''[[The Office (U.S. TV series)|The Office]]''. He was promoted to a series regular beginning in [[The Office (U.S. season 7)|Season 7]].<ref>{{Cite web|url=http://ausiellofiles.ew.com/2010/06/16/office-promotes-zach-woods/|title=Exclusive: 'The Office' promotes 'Gabe' to series regular|work=Entertainment Weekly's EW.com|date=June 16, 2010|accessdate=June 16, 2010}}</ref>
Woods is a regular performer at the [[Upright Citizens Brigade Theatre]] and is part of the improvisational sketch troupe "The Stepfathers", whose members also include [[Bobby Moynihan]] and [[Chris Gethard]].<ref>[http://newyork.ucbtheatre.com/shows/717 The Stepfathers]</ref> He has taught improv at [[Columbia University]], [[Duke University]] and Lincoln Center.<ref>{{cite web|title=UCB Theatre - Zach Woods|url=http://newyork.ucbtheatre.com/performers/314}}</ref> He has appeared in such films as ''[[In the Loop (film)|In The Loop]]'', ''[[The Other Guys]]'' and appeared in the [[CollegeHumor]] skit "Adam and Eve in the Friends Zone". Woods will also appear in the upcoming third season of [[HBO]]'s ''[[Bored to Death]]'', which begins airing in late 2011.
In 2010, Woods appeared as a zombie in a [[Starburst (confectionery)|Starburst candy]] commercial.<ref>{{cite web |url=http://adweek.blogs.com/adfreak/30-freakiest-ads-of-2010.html |title=Starburst "Zombie" Commercial |author=Tim Nudd |date=1 December 2010 |work=The 30 Freakiest Ads of 2010 |publisher=AdFreak.com |accessdate=6 February 2011}}</ref>
